         return(

             <div key = {d.id}>
                 <table id="table" >
<tr>
    <td  >المدن</td>
    <td >عدد السكان</td>
    <td>
    <button > تعديل   </button> 
    <button onClick="delet()"> حدف  </button> 
    </td>
</tr>
    <tr >
    <td >{d.citie}</td>
    <td >{d.peples}</td>
</tr>
</table>
                 
             </div>
         )   
        })}
        </div>
        </div>
    )
    
}
